import React, { Component } from 'react';
import './App.css';




class Album extends Component {
  constructor(props) {
    super(props);
    this.state = {
    Album1:[],
    };

  }
   
  componentWillMount() {
    const endpoint = "http://localhost:8000/albums/";
    fetch(endpoint)
    .then (responce => responce.jason())
    .then(result=> this.setState({Album1:result}));
  }
  
  render() {
    const {Album1} = this.state;

    return (
      !Album1.lenght ?
      <p>Nothin To Show</p>
      :
      <div className="column">
        <table className="table">
            <thead><tr>{Object.entries(Album1[0]).map((el,i) => <th key={i}>{el[0]}</th>)}
          </tr>
          </thead>
        <tbody>
          {Album1.map(el =>(
            <tr key={el.id}>
              {Object.entries(el).map((el,i) => <td key={i}>{el[1]}</td>)}
            </tr>
          ))}
        </tbody>
        </table>
      </div>

    );
  }



}
export default Album;
